const GetSeller = async idcliente => {

    const myHeaders = new Headers();
	myHeaders.append('Content-Type', 'application/json');

	console.log("pico para tabla:", idcliente);

	const requestOptions = {
		method: 'POST',
		headers: myHeaders,
		body:  JSON.stringify({ id_cliente: idcliente })
	};

	fetch('https://fl8vvup0y0.execute-api.us-east-1.amazonaws.com/dev/getseller', requestOptions)
		.then(response => response.json())
		.then(result => console.log(result))
		.catch(error => console.log('error', error));

	return '';
};

export default GetSeller;
